exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.hybiquges.com/${bid.idPrefix()}/${bid}/index.html`;return parseCatalog(url,"div#list>dl>dd",{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}}).then(_=>{const regex=/^\d+\./;if(2<_.length&&regex.test(_[0].name)&&regex.test(_[1].name)&&regex.test(_[2].name))for(let c of _)c.name=c.name.replace(regex,"").trim();return _})};